import React from 'react'
import { ProductData } from './ProductsData';
import { useState } from 'react';
export default function RecomForm() {
  const data=ProductData

  function aa(){
    const a=[];
    for (let i = 0; i < data.length; i++) {
        if(data[i].gender=="mens"){
          a.push(data[i]);
        }
    }

   
    return a;
  }
  const bb=aa();


  return (
     <div>
      {bb.map((items)=>
        {items.gender}
     
      )}

     </div>
  );
}
